import React from 'react';
import { Link } from 'react-router-dom';
import { Navbar, Nav } from 'react-bootstrap';

const NavBar = () => {
  return (
    <div className="NavBar">
      <ul className="list-inline">
        <li className="active NavBarItems">Boxing</li>
        <li className="NavBarItems">CrossFit</li>
        <li className="NavBarItems">Yoga</li>
        <li className="NavBarItems">Pilate</li>
        <li className="NavBarItems">Exercise</li>
        <li className="NavBarItems">Health</li>
        <li className="NavBarItems">Exercise</li>
        <li className="NavBarItems1">Health</li>
      </ul>
    </div>
  );
};

export default NavBar;
